import 'tip.dart';

class AmountDetails {
  Tip? tip;

  AmountDetails({this.tip});

  factory AmountDetails.(
      Map<String, dynamic> json) {
    return AmountDetails(
      tip: json['tip'] == null
          ? null
          : Tip
              .(
                  json['tip'] as Map<String, dynamic>),
    );
  }

  Map<String, dynamic>
      () {
    return {
      'tip': tip
          ?.(),
    };
  }
}
